import axios from 'axios';
import {
    LOGIN_USER,
    REGISTER_USER,
    AUTH_USER,
    LOGOUT_USER,
} from './types';

import { SERVER_URL } from '../config';

export const registerUser = (dataToSubmit) => {
    try {
        let responseData = axios.post(`${SERVER_URL}/register`, dataToSubmit)
            .then(response => {
                response.data
            });
        // return {
        //     type: REGISTER_USER,
